  input: "\"TEXT\",\"F3XA\",\"C00140590\",\"December 16, 2005\t\t      Katrina Senger
    \ Federal Elections Commission    RE:  California Republican Party           FEC
    ID#  C0014590           May Monthly (4/1/05-4/30/05)    Dear Katrina Senger,    Please
    be advised that the committee is paying for its voter registration expenses in
    the following manner as previously directed by the Federal Elections Commission.
    \ The committee pays the federal share directly out of the federal account and
    pays the nonfederal or Levin share directly out of the nonfederal or Levin account.
    \   Additionally, the committee is aware of the types of activity that must be
    reported on Line 30(b) as FEA.  The committee is also aware that certain public
    communications must be reported if a federal candidate is identified.  Since the
    committees controller and treasurer review each expenditure and its classification,
    please be advised that if there is an expenditure that is identified as FEA it
    is paid and reported accordingly in the correct manner.    In regard to occupation
    and employer information requested, a letter is sent to those donors whose contributions
    exceed $200, but did not provide us with their employer and occupation on our
    initial contribution solicitation which sites the FEC regulation for the requested
    information.  The committees policy is to send a follow-up letter within thirty
    days of the original contribution to request this information with a pre-addressed
    envelope enclosed for the return of such information.  All such information received
    is reported accordingly.      Sincerely,    Doug Boyd  California Republican Party\""
